import React from "react";
import CssBaseline from "@material-ui/core/CssBaseline";
import clsx from "clsx";
import { makeStyles } from "@material-ui/core/styles";
import Container from "@material-ui/core/Container";
import Grid from "@material-ui/core/Grid";
import Paper from "@material-ui/core/Paper";

import AllEmployeesTable from "../components/AllEmployeesTable";

const drawerWidth = 240;

const useStyles = makeStyles((theme) => ({
  root: {
    display: "flex",
  },
  toolbar: {
    paddingRight: 24, // keep right padding when drawer closed
  },
  toolbarIcon: {
    display: "flex",
    alignItems: "center",
    justifyContent: "flex-end",
    padding: "0 8px",
    ...theme.mixins.toolbar,
  },
  appBar: {
    zIndex: theme.zIndex.drawer + 1,
    transition: theme.transitions.create(["width", "margin"], {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.leavingScreen,
    }),
  },
  appBarShift: {
    marginLeft: drawerWidth,
    width: `calc(100% - ${drawerWidth}px)`,
    transition: theme.transitions.create(["width", "margin"], {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.enteringScreen,
    }),
  },
  menuButton: {
    marginRight: 36,
  },
  menuButtonHidden: {
    display: "none",
  },
  title: {
    flexGrow: 1,
  },
  drawerPaper: {
    position: "relative",
    whiteSpace: "nowrap",
    width: drawerWidth,
    transition: theme.transitions.create("width", {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.enteringScreen,
    }),
  },
  drawerPaperClose: {
    overflowX: "hidden",
    transition: theme.transitions.create("width", {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.leavingScreen,
    }),
    width: theme.spacing(7),
    [theme.breakpoints.up("sm")]: {
      width: theme.spacing(9),
    },
  },
  appBarSpacer: theme.mixins.toolbar,
  content: {
    flexGrow: 1,
    height: "100vh",
    overflow: "auto",
  },
  container: {
    paddingTop: theme.spacing(9),
    paddingBottom: theme.spacing(4),
    border: "1px solid",
    height: "95vh",
  },
  paper: {
    padding: theme.spacing(2),
    display: "flex",
    overflow: "auto",
    flexDirection: "column",
    border: "1px solid",
  },
  fixedHeight: {
    // height: 240,
    height: "80vh",
  },
}));

const headCells = [
  {
    name: "name",
    numeric: false,
    disablePadding: true,
    label: "Name",
  },
  {
    name: "icno",
    numeric: false,
    disablePadding: true,
    label: "I/C No",
  },
  {
    name: "gender",
    numeric: false,
    disablePadding: true,
    label: "Gender",
  },
  { name: "age", numeric: false, disablePadding: true, label: "Age" },
  {
    name: "email",
    numeric: false,
    disablePadding: true,
    label: "Email",
  },
];

const datarows = [
  {
    id: "1",
    name: "Jackie Tan",
    icno: "30-123123",
    gender: "Male",
    age: 45,
    email: "jackie@abc.com",
  },
  {
    id: "2",
    name: "Jamie Wong",
    icno: "30-212121",
    gender: "Female",
    age: 35,
    email: "jamie@abc.com",
  },
  {
    id: "3",
    name: "James Phan",
    icno: "30-332233",
    gender: "Male",
    age: 25,
    email: "james@abc.com",
  },
  {
    id: "4",
    name: "Albert Tan",
    icno: "30-434343",
    gender: "Male",
    age: 42,
    email: "albert@abc.com",
  },
  {
    id: "5",
    name: "Melissa Wong",
    icno: "30-545454",
    gender: "Female",
    age: 22,
    email: "melissa@abc.com",
  },
  {
    id: "6",
    name: "Angela Wong",
    icno: "30-454545",
    gender: "Female",
    age: 25,
    email: "angela@abc.com",
  },
  {
    id: "7",
    name: "Amy Chin",
    icno: "30-737373",
    gender: "Female",
    age: 21,
    email: "amy@abc.com",
  },
];

const AllEmployees = () => {
  const classes = useStyles();
  const fixedHeightPaper = clsx(classes.paper, classes.fixedHeight);
  return (
    <div>
      <CssBaseline />
      <div className={classes.appBarSpacer}>
        <Container maxWidth="lg" className={classes.container}>
          <Grid container spacing={3}>
            {/* <Grid item xs={12} md={8} lg={9}> */}
            <Grid item xs={12}>
              <Paper className={fixedHeightPaper}>
                <AllEmployeesTable
                  title="All Employees"
                  headCells={headCells}
                  datarows={datarows}
                />
              </Paper>
            </Grid>
          </Grid>
        </Container>
      </div>
    </div>
  );
};

export default AllEmployees;
